<script>
(function () {
  // ====== mini toast untuk notifikasi singkat ======
  function showNotice(text) {
    const now = Date.now();
    if (showNotice._last && now - showNotice._last < 1200) return; // throttle
    showNotice._last = now;

    let el = document.getElementById('noinspect-toast');
    if (!el) {
      el = document.createElement('div');
      el.id = 'noinspect-toast';
      Object.assign(el.style, {
        position: 'fixed',
        left: '50%',
        bottom: '20px',
        transform: 'translateX(-50%)',
        padding: '10px 14px',
        background: '#111',
        color: '#fff',
        borderRadius: '10px',
        boxShadow: '0 10px 24px rgba(0,0,0,.35)',
        fontFamily: 'system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif',
        fontSize: '14px',
        zIndex: 2147483647,
        opacity: '0',
        transition: 'opacity .2s ease'
      });
      document.body.appendChild(el);
    }
    el.textContent = text;
    el.style.opacity = '1';
    clearTimeout(el._hide);
    el._hide = setTimeout(() => (el.style.opacity = '0'), 1800);
  }

  function block(e, msg) {
    e.preventDefault();
    e.stopPropagation();
    if (typeof e.stopImmediatePropagation === 'function') e.stopImmediatePropagation();
    if (msg) showNotice(msg);
    return false;
  }

  // 1) Blokir klik kanan
  document.addEventListener('contextmenu', (e) => block(e, 'Klik kanan dimatikan.'), { capture: true });

  // 2) Blokir kombinasi keyboard umum (View Source, DevTools, dll)
  document.addEventListener('keydown', function (e) {
    const key = (e.key || '').toLowerCase();
    const ctrl = e.ctrlKey || e.metaKey; // Ctrl (Win) / ⌘ (Mac)
    const shift = e.shiftKey;

    if (key === 'f12' || e.keyCode === 123) return block(e, 'F12 dimatikan.');
    if (ctrl && key === 'u') return block(e, 'Ctrl + U (View Source) dimatikan.');
    if (ctrl && key === 'i') return block(e, 'Ctrl + I dimatikan.');
    if (ctrl && key === 's') return block(e, 'Ctrl + S dimatikan.');
    if (ctrl && key === 'p') return block(e, 'Ctrl + P dimatikan.');
    if (ctrl && shift && key === 'i') return block(e, 'Ctrl + Shift + I dimatikan.');
    if (ctrl && shift && key === 'j') return block(e, 'Ctrl + Shift + J dimatikan.');
    if (ctrl && shift && key === 'c') return block(e, 'Ctrl + Shift + C dimatikan.');
  }, { capture: true });

  // 3) (Opsional) Kurangi copas & drag
  document.addEventListener('selectstart', (e) => block(e, 'Select/Copy dinonaktifkan.'), { capture: true });
  document.addEventListener('dragstart', (e) => block(e, 'Drag & Drop dimatikan.'), { capture: true });

